    def test_make_pcoa_webgl_string_from_files(self):
        """make a webgl output from pcoa data and a mapping file"""
        #seed(111)
        # check it creates the webgl string
        webgl_string = make_pcoa_webgl_string_from_files(self.pcoa_headers,\
            self.pcoa_points, self.pcoa_labels, self.mapping_headers, self.mapping_data)
        self.assertEquals(webgl_string, expected_webgl_string_a)

        # check it raises an exception because of the lack of pcoa_headers
        with self.assertRaises(ValueError):
            webgl_string = make_pcoa_webgl_string_from_files([],\
                self.pcoa_points, self.pcoa_labels, self.mapping_headers, self.mapping_data)

